import { Cancion } from "./cancion";
import { Grupos } from "./grupos";
import { Artistas } from "./artistas";
import { GenerosMusicales } from "./generosMusicales";

/**
 * TRABAJO GRUPO L
 * @class Album contiene las especificaciones de los
 * distintos álbumes
 * @param nombreAlbum del album
 * @param autores autor del album (artista o grupo)
 * @param genero array de GenerosMusicales
 * @param yearPublicacion año de publicación del album
 * @param canciones array de Cancion
 */
export class Album {
  private nombreAlbum: string;
	private autores: Grupos | Artistas;
	private genero: GenerosMusicales[];
	private yearPublicacion: number;
	private canciones: Cancion[];
	constructor(nombreAlbum: string, autores: Grupos | Artistas, genero: GenerosMusicales[],
		yearPublicacion: number, canciones: Cancion[]){
			this.nombreAlbum = nombreAlbum;
			this.autores = autores;
			this.genero = genero;
			this.yearPublicacion = yearPublicacion;
			this.canciones = canciones;
			if(autores instanceof Artistas){
				autores.autoSetAlbumes(this);
			}
			genero.forEach(element => {
				element.autoSetAlbumes(this);
			});
		}
	/**
	 * Getter del nombre del album
	 * @returns nombre del album
	 */
	getNombreAlbum(){
		return this.nombreAlbum;
	}
	/**
	 * Getter de autor del album
	 * @returns el nombre del grupo o el nombre del artista
	 */
	getAutores(){
		if (this.autores instanceof Grupos){
			return this.autores.getNombreGrupo();
		} else {
			return this.autores.getNombreArtista();
		}
	}
	/**
	 * Getter de los géneros musicales del album
	 * @returns géneros musicales del album
	 */
	getGenero(){
		let generos: string[] = [];
		this.genero.forEach(element => {
			generos.push(element.getNombreGenero());
		});
		return generos;
	}

	/**
	 * Getter del año de publicación del album
	 * @returns año de publicación
	 */
	getYear(){
		return this.yearPublicacion;
	}

	/**
	 * Getter del nombre de las canciones del album
	 * @returns nombre de las canciones
	 */
	getCanciones(){
		return this.canciones;
	}

	/**
	 * Setter del nombre del album
	 * @param nombre del album
	 */
	setNombreAlbum(nombre: string){
		this.nombreAlbum = nombre;
	}

	/**
	 * Setter del autor del album
	 * @param autor del album que puede ser un grupo o un artista
	 */
	setAutores(autor: Grupos | Artistas){
		if (autor instanceof Grupos){
			this.autores = autor;
		} else {
			this.autores = autor;
		}

	}

	/**
	 * Setter de los géneros musicales del album
	 * @param genero musicales del album
	 */
	setGenero(genero: GenerosMusicales[]){
		this.genero = [];
    this.genero = genero;
	}

	/**
	 * Setter del año de publicación del album
	 * @param year de publicación
	 */
	setYear(year: number){
		this.yearPublicacion = year;
	}

	/**
	 * Setter de las canciones del album
	 * @param cancion del (album array de canciones)
	 */
	setCanciones(cancion: Cancion[]){
		this.canciones = [];
		this.canciones = cancion;
	}
}

import { Album } from "./album";
import { Artistas } from "./artistas";
import { GenerosMusicales } from "./generosMusicales";

/**
 * TRABAJO GRUPO L
 * @class Grupos contiene las especificaciones de los
 * distintos grupos
 * @param nombreGrupo nombre del grupo
	 * @param artistas Array que almacena a varios artistas
	 * @param yearGrupo Entero que representa el año de creación del grupo
	 * @param genero Array que almacena varios Generos Musicales distintos
	 * @param albumes Array que almacena distintos álbumes
	 * @param oyentes Entero que representa el número de oyentes mensuales
 */
export class Grupos {
  private nombreGrupo: string;
	private artistas: Artistas[];
	private yearGrupo: number;
	private genero: GenerosMusicales[];
	private albumes: Album[];
	private oyentes: number;

	constructor(nombreGrupo: string){
		this.nombreGrupo = nombreGrupo;
	}

	/**
	 * @function construirGrupo Método para incializar las propiedades restantes de
	 * la clase Grupos
	 * @param artistas Array que almacena a varios artistas
	 * @param yearGrupo Entero que representa el año de creación del grupo
	 * @param genero Array que almacena varios Generos Musicales distintos
	 * @param albumes Array que almacena distintos álbumes
	 * @param oyentes Entero que representa el número de oyentes mensuales
	 */
	construirGrupo(artistas: Artistas[], yearGrupo: number, genero: GenerosMusicales[], albumes: Album[], oyentes: number){
		this.artistas = artistas;
		this.yearGrupo = yearGrupo;
		this.genero = genero;
		this.albumes = albumes;
		this.oyentes = oyentes;
		genero.forEach(element => {
			element.autoSetGrupos(this);
		});
		artistas.forEach(element => {
			element.autoSetGrupos(this);
		});

	}


	/**
	 * Getter del nombre de los grupos
	 * @returns nombre del grupo
	 */
	getNombreGrupo(){
		return this.nombreGrupo;
	}

	/**
	 * Getter de los artistas
	 * @returns artistas
	 */
	getArtistas(){
		let artistas_: string[] = [];
        this.artistas.forEach(element => {
            artistas_.push(element.getNombreArtista());
        });
		return artistas_;
	}

	/**
	 * Getter del año de creación del grupo
	 * @returns año del grupo
	 */
	getYearGrupo(){
		return this.yearGrupo;
	}

	/**
	 * Getter de los géneros musicales
	 * @returns géneros
	 */
	getGenero(){
		let generos: string[] = [];
        this.genero.forEach(element => {
            generos.push(element.getNombreGenero());
        });
        return generos;
	}

	/**
	 * Getter de los albumes
	 * @returns albumes
	 */
	getAlbumes(){
		return this.albumes;
	}

	/**
	 * Getter de los oyentes mensuales
	 * @returns oyentes mensuales
	 */
	getOyentes(){
		return this.oyentes;
	}

	/**
	 * Setter del nombre del grupos
	 * @param nombre del grupo
	 */
	setNombreGrupo(nombre: string){
		this.nombreGrupo = nombre;
	}

	/**
	 * Setter de los artistas
	 * @param artista del grupo
	 */

	setArtistas(artistas: Artistas[]){
		this.artistas = [];
    this.artistas = artistas;
	}

	/**
	 * Setter del año de creación del grupo
	 * @param year del grupo
	 */
	setYearGrupo(year: number){
		this.yearGrupo = year;
	}

	/**
	 * Setter de los géneros del grupo
	 * @param genero musicales
	 */

	setGenero(genero: GenerosMusicales[]){
		this.genero = [];
    this.genero = genero;
	}

	/**
	 * Setter de los albumes del grupo
	 * @param album del grupo
	 */
	setAlbumes(album: Album[]){
		this.albumes = [];
		this.albumes = album;
	}

	/**
	 * Setter de los oyentes mensuales
	 * @param oyente mensuales
	 */
	setOyentes(oyente: number){
		this.oyentes = oyente;
	}
}

import { Cancion } from "./cancion";
import { Grupos } from "./grupos";
import { Album } from "./album";
import { GenerosMusicales } from "./generosMusicales";

/**
 * TRABAJO GRUPO L
 * @class Artistas contiene las especificaciones de los
 * distintos artistas
 * @param nombreArtista nombre del artista
 * @param grupos array de Grupos 
 * @param generos array de GenerosMusicales
 * @param albumes array de Album
 * @param canciones array de Cancion
 * @param oyentes número de oyentes 
 */
export class Artistas {
	private nombreArtista: string;
	private grupos: Grupos[] = [];
	private generos: GenerosMusicales[] = [];
	private albumes: Album[] = [];
	private canciones: Cancion[] = [];
	private oyentes: number;

	constructor(nombreArtista: string){
		this.nombreArtista = nombreArtista;
	}
	/**
/**
	 * @function construirArtista Método para inicializar las propiedades restantes de
	 * la clase Artista
	 * @param canciones canciones del artista
	 * @param oyentes oyentes del artista
	 */
	construirArtista( canciones: Cancion[], oyentes: number){

		this.canciones = canciones;
		this.setOyentes(oyentes);
		let auxGeneroCanciones: GenerosMusicales[];
		this.canciones.forEach(element => {

			auxGeneroCanciones = element.getGenero();
			auxGeneroCanciones.forEach(elemento => {
				let contador: number = 0;
				for(let i = 0; i < this.generos.length; i++){
					if (elemento === this.generos[i]){
						contador++;
					}
				}
				if (contador === 0){
					this.generos.push(elemento);					
					contador = 0;
				}	
				contador = 0;
			});
		});
		this.generos.forEach(element => {
			element.autoSetArtistas(this);
		});
	}
	/**
	 * Getter del nombre del artista
	 * @returns nombre del artista
	 */
	getNombreArtista(){
		return this.nombreArtista;
	}

	/**
	 * Getter de los grupos del artista
	 * @returns grupos del artista
	 */
	getGrupos(){
		let grupos_: string[] = [];
        this.grupos.forEach(element => {
            grupos_.push(element.getNombreGrupo());
        });
		return grupos_;
	}

	/**
	 * Getter de los géneros musicales 
	 * @returns géneros musicales
	 */
	getGeneros(){
		let generos_: string[] = [];
        this.generos.forEach(element => {
            generos_.push(element.getNombreGenero());
        });
        return generos_;
	}

	/**
	 * Getter de los albumes del artista
	 * @returns albumes
	 */
	getAlbumes(){
		let albumes_: string[] = [];
    this.albumes.forEach(element => {
      albumes_.push(element.getNombreAlbum());
    });   
		return albumes_;
	}

	/**
	 * Getter de las canciones del artista
	 * @returns canciones del artista
	 */
	getCanciones(){
		let canciones_: string[] = [];
    this.canciones.forEach(element => {
      canciones_.push(element.getNombreCancion());
    }); 
		return canciones_;
	}

	/**
	 * Getter del número de oyentes del artista
	 * @returns oyentes del artista
	 */
	getOyentes(){
		return this.oyentes;
	}

	/**
	 * Getter del numero de grupos al que pertenece el artista
	 * @returns el tamaño del atributo grupo
	 */
	getGrupoSize(){
		return this.grupos.length;
	}

	/**
	 * Setter del nombre del artista
	 * @param nombre del artista
	 */
	setNombreArtista(nombre: string){
		this.nombreArtista = nombre;
	}

	/**
	 * Setter del nombre del grupo
	 * @param grupo del artista
	 */
	setGrupos(grupo: Grupos[]){
		this.grupos = []
		this.grupos = grupo;
	}
		/**
	 * Setter del grupo que invoca al artista
	 * @param grupo del artista
	 */
		 autoSetGrupos(grupo: Grupos){
			this.grupos.push(grupo);
		}


	/**
	 * Setter del genero del artista
	 * @param genero del artista
	 */
	setGeneros(genero: GenerosMusicales[]){
		this.generos = [];
    this.generos = genero;
	}

	/**
	 * Setter de las canciones del artista
	 * @param cancion del artista
	 */
	setCanciones(cancion: Cancion[]){
	this.canciones = [];
		this.canciones = cancion;
	}
	/**
	 * Setter de los albumes del artista
	 * @param album del artista
	 */
	 setAlbumes(album: Album[]){
		this.albumes.forEach(element => {
			this.albumes.pop();
		});
		album.forEach(element => {
			this.albumes.push(element);
		});
	}
		/**
	 * Setter de los albumes del artista que rellenan a un artista en la clase album
	 * @param album del artista
	 */
		 autoSetAlbumes(album: Album){
			this.albumes.push(album);
		}

	/**
	 * Setter de los oyentes 
	 * @param oyentes mensuales
	 */
	setOyentes(oyentes: number){
		let oyentesgrupales: number = 0;
		for(let i: number = 0; i < this.getGrupoSize(); i++){
			oyentesgrupales = oyentesgrupales + this.grupos[i].getOyentes();
		}
		this.oyentes = oyentes + oyentesgrupales;
	}
}

